        detailfull:" Sản phẩm bắt chước thiết kế của kính bảo hộ, các phần hình tròn lớn che hết mắt và thái dương, để lại ấn tượng sâu sắc cho người đối diện. Gọng to bản, thiết kế cách tân bằng nhựa trong suốt giúp kính trông thanh thoát và hiện đại hơn, xứng đáng là phụ kiện thời trang cao cấp.Nếu bạn muốn lựa chọn thiết kế kính mắt sang trọng, chất liệu đảm bảo và hậu mãi hấp dẫn tuyệt đối phụ kiện thời trang mới nhất, đừng quên đến với thương hiệu phụ kiện thời trang cao cấp ELLY, chắc chắn bạn sẽ hài lòng.Còn chần chờ gì mà hãy ghé thăm một trong hơn 60 showroom của ELLY trên toàn quốc để trải nghiệm ngay phong cách thời trang Pháp trong từng thiết kế nhé.Gỗ luôn là chất liệu gợi nhớ đến vẻ đẹp sang trọng, quyến rũ của sự retro cổ điển. Nếu bạn không quá thích những chiếc kính hiện đại, thì thiết kế kính gọng gỗ thanh lịch và thư sinh dưới đây sẽ là lựa chọn lý tưởng của bạn .Mắt kính được thiết kế kiểu mắt mèo, gọng kính vừa và nhỏ ôm sát khuôn mặt, giúp tôn lên sống mũi cao và giúp trung tâm sáng và rạng rỡ hơn. Thiết kế khung thanh mảnh nhưng không hề đơn điệu nhờ chi tiết ốp gỗ đậm chất vintage ở phần kính phía trên. Không cứng nhắc như kính toàn gỗ, cũng không nhí nhảnh, trẻ con như gọng nhựa, thiết kế này mang đậm phong cách cổ điển cuốn hút nhưng cũng không thiếu sự trẻ trung, rất thích hợp cho các chàng trai diện nơi công sở. "
