const getAllAccessory = () => accessories

const getAccessory = (count) => {
    const max = accessories.length - count
    const min = 0
    const start = Math.floor(Math.random() * (max - min) + min)
    return accessories.slice(start, start + count)
}


const getAccessorytBySlug =(slug) => accessories.find(e =>e.slug===slug)

const accessoryData = {
    getAllAccessory,
    getAccessory,
    getAccessorytBySlug
}

export default accessoryData